import React, { Component } from 'react';
import ToByList from './ToBuyList'
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <h1>Hello World</h1>
        <ToByList
          color={"#aeda6d"}
          title={"fruits"}
          initialdata={['apples','bannana']}
        />
         <ToByList
          color={"#8bcfe8"}
          title={"vegetables"}
          initialdata={['tomatoes', 'cucumbers', 'carrots']}
        />
         <ToByList
          color={"#e293b1"}
          title={"fruits"}
          initialdata={['apples','bannana']}
        />
      </div>
    );
  }
}

export default App;
